import React from 'react'
import './CartButton.css'
import { useDispatch } from 'react-redux'
import { addToCart, increment } from '../../../redux/cart'

function AfterCart() {
    const dispatch=useDispatch()
  return (
    <div className='after-cart'>
        <button className='cart-counter-button' onClick={()=>dispatch(increment)}>-</button>
        <div className='cart-counter'>1</div>
        <button className='cart-counter-button ' onClick={()=>dispatch()}>+</ button>

    </div>
  
  )
}

export default AfterCart
